    const enteredData= [
      ...enteredYearlyData
    ];
    setCalculations(enteredData);
  };

  return (
    <div>
      <Header />
      <Form onSaveYearlyData={saveYearlyDataHandler} /> 

      <Table items={calculations}/>

    </div>
  );
}

export default App;
